Alpine.data("etapasTabFuncionarios",()=>({closeModal(n){n().funcionarioEncontrado=null,n().inputsDisabled=!0,n().inputsFuncionario.nome=null,n().inputsFuncionario.cpf=null,n().inputsFuncionario.rg=null,n().inputsFuncionario.telefone=null,n().inputsFuncionarioObra.funcao=null,n().inputsFuncionarioObra.conselho=null,n().modal=!1},delFuncionario(n,o){this.$store.dialog.show("Excluir funcionário",`Realmente deseja excluir o funcionário "${n.funcionario.nome}" com o cpf "${n.funcionario.cpf}"?`,{cancel:{},confirm:{text:"Sim, excluir!",action:()=>o().delFuncionario(n.id)}})}}));
